import fraaiOrMooi from "./fraaiOrMooi";

export async function getCount(type) {
    let countDoc = await db.collection('stats').doc(type).get();
    if (!countDoc.exists) return getRealFileCount(type)
    return countDoc.data().count
}

export async function incrementCount(type) {
    return db.collection('stats').doc(type).set(
        {
            count: admin.firestore.FieldValue.increment(1)
        },
        { merge: true }
    );
}


export async function getRealFileCount(type) {
    const [files] = await admin.storage().bucket().getFiles({ prefix: type, directory: `/${type}` })
    await db.collection('stats').doc(type).set({ files: files.length, lastUpdated: admin.firestore.Timestamp.now() }, { merge: true })
    if (dev) console.log(`set files ${type} count`)
    return files.length;
}


export async function handleCountRequest(request, response) {
    const documentName = fraaiOrMooi(
        Object.values(request.params).join('/').split('/').join('').toLowerCase().split(''),
        'fraaievrouw',
        'mooieman'
    );
    let max = await _getCount(documentName);
    return response.json(String(max));
}
